import { useState, useEffect } from "react";
import { useHistory } from "react-router-dom";
import { fetchPortfolio } from "../Api/index";
const Portfolio = () => {
  const history = useHistory();
  const [load, setLoad] = useState(0);

  const [Portfol, setPortfol] = useState([]);

  function checkuser() {
    const token = localStorage.getItem("jwtauth");
    if (!token) {
      history.push("/login");
    }
  }
  const onload = async () => {
    const { data } = await fetchPortfolio();
    setPortfol(data);
    console.log(Portfol, "Portfol");
  };
  useEffect(async () => {
    const boole = await fetchPortfolio();
    if (boole.data) {
      setLoad(1);
    }
    checkuser();
    onload();
  }, []);

  return (
    <div className="container portfolio_main">
      <div id="projects" className="filter">
        <div className="container">
          <div className="row">
            <div className="col-lg-12">
              <div className="section-title">PROJECTS</div>
              <h2>Projects That We're Proud Of</h2>
            </div>{" "}
            {/* end of col */}
          </div>{" "}
          {/* end of row */}
          <div className="row">
            <div className="col-lg-12">
              {/* Filter */}
              {/* end of button group */}

              {Portfol.map((s) => (
                <div class="row mb-2">
                  <div class="col-md-6">
                    <div class="row no-gutters border rounded overflow-hidden flex-md-row mb-4 shadow-sm h-md-250 position-relative">
                      <div class="col p-4 d-flex flex-column position-static">
                        <strong class="d-inline-block mb-2 text-primary">
                          {s.title}
                        </strong>

                        <p class="card-text mb-auto">{s.description}</p>
                      </div>
                      <div class="col-auto d-none d-lg-block">
                        <img
                          class="bd-placeholder-img"
                          width="200"
                          height="250"
                          src={s.photo}
                          preserveAspectRatio="xMidYMid slice"
                          focusable="false"
                          role="img"
                          aria-label="Placeholder: Thumbnail"
                        />
                      </div>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Portfolio;
